gwi:function(){return"Le syst\xe8me est con\xe7u pour l'anonymat et la protection des donn\xe9es, c'est pourquoi nous avons d\xe9cid\xe9 de ne pas adopter une approche avec suivi de localisation. Au lieu de cela, nous utilisons des codes QR qui peuvent \xeatre scann\xe9s lors de la participation \xe0 un \xe9v\xe9nement. \nLes codes QR contiennent chacun le nom de l'\xe9v\xe9nement ainsi qu'un identifiant unique g\xe9n\xe9r\xe9 de mani\xe8re al\xe9atoire. \nCes donn\xe9es sont uniquement stock\xe9es sur les appareils des participants : inside et organisateur : inside. \nSi un utilisateur confirme un r\xe9sultat de test positif, les identifiants de tous les \xe9v\xe9nements auxquels il a particip\xe9 au cours des 14 derniers jours sont envoy\xe9s \xe0 un serveur central avec la p\xe9riode de participation et y sont stock\xe9s. \xc9tant donn\xe9 que seul l'ID d'\xe9v\xe9nement est stock\xe9, le serveur ne peut pas d\xe9terminer de quel type d'\xe9v\xe9nement il s'agit. \nTous les appareils avec une application install\xe9e v\xe9rifient \xe0 intervalles r\xe9guliers si l'un des ID d'\xe9v\xe9nement qu'ils ont visit\xe9s a \xe9t\xe9 stock\xe9 sur le serveur, et si c'est le cas, si les p\xe9riodes se chevauchent. Si c'est le cas, l'application d\xe9clenche une alarme et les utilisateurs peuvent se faire tester. \nSi l'application d\xe9tecte que l'ID d'un \xe9v\xe9nement est stock\xe9 sur le serveur, la liste des participants ajout\xe9s manuellement et leurs temps de pr\xe9sence sont \xe9galement affich\xe9s avec les heures synchronis\xe9es stock\xe9es sur le serveur. Si des participants ajout\xe9s manuellement ont assist\xe9 \xe0 l'\xe9v\xe9nement pendant la p\xe9riode en question, leurs donn\xe9es personnelles seront transmises sous forme crypt\xe9e au serveur, qui les transmet au service de sant\xe9. L\xe0, les donn\xe9es peuvent \xeatre \xe0 nouveau d\xe9crypt\xe9es afin d'informer les personnes concern\xe9es (SMS, t\xe9l\xe9phone, courrier)."},
